import { Component } from "react";
import styles from './styles.css'
import Logo from './Logo'

class Navbar extends Component {
    render() {
        return (
            <nav style={styles} className="navbar">
                <Logo />
                <p>Carro</p>
            </nav>
        )
    }
}

export default Navbar
